  true,\n\t\"url\": null,\n\t\"notes\": \"The USAID ENS provides quick and effective
  notification messages during any emergency affecting the Ronald Reagan Building,
  SA-44, Potomac Yards and USAID Washington D.C. personnel. This system delivers important
  emergency alerts, notifications and updates on a range of devices. When an incident
  or emergency occurs, authorized USAID personnel can rapidly notify subscribers using
  this agency-wide alert system. The USAID ENS is subscribers' personal connection
  to real-time updates, instructions on where to go, what to do, or what not to do,
  who to contact and other important information.\",\n\t\"license_title\": \"Other
